import { useEffect } from "react";
import styles from "./FabricBoard.module.css";
import { fabric } from "fabric";

export default function FabricBoard() {
  useEffect(() => {
    var canvas = new fabric.Canvas("c", { isDrawingMode: true });
  }, []);

  return (
    <div>
      <button>Clear</button>
      <canvas id="c"></canvas>
    </div>
  );
}
